<template>
	<!-- 情景模式页面 -->
	<view class="" style="height: 100%">
		<view class="logout" v-if="logoutStates">
			<image
				src="../../../static/img/login-img.png"
				mode=""
				class="logo"
			></image>
			<view class="index-hint">
				<text>请您先添加设备在使用情景模式</text>
				<text>立即添加</text>
			</view>
			<view class="add-btn-back" @click.stop="toLogin">
				<image src="../../../static/img/add.png" mode=""></image>

				<text>添加设备</text>
			</view>
		</view>
		<view class="mode" v-else>
			<view class="mode-item" v-for="(item, index) in list" :key="index">
				<view class="item-left">{{ item.title }}</view>
				<view
					class="item-right"
					v-if="item.state == 1"
					@click="stayHome(item, 2)"
				>
					<view class="">回家模式</view>
					<image src="../../../static/img/modekaiguan.png" mode=""></image>
				</view>
				<view class="item-right" v-else @click="stayHome(item, 1)">
					<view class="">离家模式</view>
					<image src="../../../static/img/download.png" mode=""></image>
				</view>
			</view>
		</view>
		<confirmationModule
			:confrimationShow="confrimationShows"
			title="提示"
			:contText="contText"
			@onConfirm="onPromptConfirm"
			@onCancels="onPromptCancels"
		></confirmationModule>
		<confirmationModule
			:confrimationShow="confrimationLongTap"
			title="重命名"
			:contText="conDelete"
			:conType="conType"
			:btnType="btnType"
		></confirmationModule>
		<confirmationModule
			:confrimationShow="hintConfrimationShows"
			title="失败"
			contType="5"
			btnType="4"
			:contText="hinContText"
			@onCancels="onPromptConfirm2"
		></confirmationModule>
		<loading ref="loading" :custom="false" :shadeClick="false"></loading>
		<mrhardTabbar></mrhardTabbar>
	</view>
</template>

<script>
import mrhardTabbar from '@/components/mrhard-tabbar/mrhard-tabbar.vue';
import confirmationModule from '@/components/confirmation-module/confirmation-module.vue';
import loading from '@/components/xuan-loading/xuan-loading.vue';
import {
	getPatternLeaving_home,
	getGroupingIndex,
	getPatternTesting,
	getPatternSend_error
} from '@/common/js/mode.js';
import { getDevicelistIndex } from '@/common/js/index.js';
export default {
	components: {
		mrhardTabbar,
		confirmationModule,
		loading
	},

	data() {
		return {
			isHome: false,
			loginType: false,
			goHomeMode: 0,
			confrimationShows: false,
			contText:
				'打开离家模式全部阀门关闭（共享设备除外），此模式下被共享人无法再开启我的设备，且情景模式无法使用，确认开启？',
			confrimationLongTap: false,
			conDelete: '删除',
			conType: 7,
			btnType: 4,
			modeType: false,
			list: [],
			dataArr: [],
			items: {},
			logoutStates: false,
			resArr: [],
			hintConfrimationShows: false,
			hinContText: ''
		};
	},
	onLoad() {},
	onShow() {
		if (uni.getStorageSync('token') == '') {
			this.logoutStates = true;
		} else {
			this.logoutStates = false;
			this.queryGroupingIndex();
			 this.queryDevicelistIndex((res)=>{
				this.dataArr =res
			});
		}
	},
	methods: {
		/*-获取分组和设备-*/
		async queryDevicelistIndex(fun) {
			let result = await getDevicelistIndex({});
			if (result.code == 2003) {
				return false;
			}
			fun(result.data) ;
		},
		async queryGroupingIndex() {
			let result = await getGroupingIndex({});
			if (result.code == 2003) {
				this.logoutStates = true;
			}
			let defaultIndex = 0;
			for (let i in result.data) {
				if (result.data[i].title == '默认分组') {
					defaultIndex = i;
				}
			}
			let str = result.data.splice(defaultIndex, 1);
			result.data.unshift(str[0]);
			console.log(result.data);
			this.list = result.data;
		},
		changeSwitch(e) {
			//切换开关事件
			uni.showToast({
				title: String(e)
			});
		},
		navigateBackCallback(e) {
			//点击返回事件
			uni.showToast({
				title: '点击了返回事件'
			});
		},
		navigateClick() {
			uni.showToast({
				title: '点击了标题事件'
			});
		},
		//情景模式switch点击事件
		switch2Change(e) {
			console.log('switch2 发生 change 事件，携带值为', e.target.value);
		},
		//切换在家、离家模式(true)事件
		stayHome(item, index) {
			console.log(item);
			let dataArrs =[]
			 this.queryDevicelistIndex((res)=>{
				dataArrs=res
				for (let i in dataArrs) {
					console.log(dataArrs[i].class.id);
					if (item.id == dataArrs[i].class.id) {
						if (dataArrs[i].device_list.length == 0) {
							uni.showToast({
								icon: 'none',
								title: '请添加设备'
							});
							return;
						}
					}
					for (let s in dataArrs[i].device_list) {
						if (dataArrs[i].device_list[s].device_state == 3) {
							uni.showToast({
								icon: 'none',
								title: '有异常设备无法使用情景模式'
							});
							return;
						}
					}
				}
				console.log(dataArrs);
				
				console.log(item.number);
				if (item.state == 1) {
					this.contText =
						'打开离家模式' +
						item.title +
						'组设备全部关闭，此模式下会锁定此组设备，确认开启？';
				} else {
					this.contText =
						'打开回家模式' + item.title + '组设备将全部解锁，确认开启？';
				}
				if (item.number <= 1) {
					this.confrimationShows = true;
				} else {
					this.queryPatternLeaving_home(item.id, item.state == 1 ? 2 : 1);
				}
				
				this.items = item;
			});

		},
		toLogin() {
			uni.showToast({
				title: '您还没有登陆，请登录',
				icon: 'none'
			});
			uni.redirectTo({
				url: '../../login/login'
			});
		},
		//添加模式事件
		addMode() {
			uni.navigateTo({
				url: '../../mode/add_mode/add_mode'
			});
		},
		//离家模式点击跳转
		liveHome() {
			if (this.isHome) {
				uni.navigateTo({
					url: '../../mode/live_home/live_home'
				});
			}
		},
		//模态框确定事件
		onPromptConfirm() {
			this.confrimationShows = false;
			this.queryPatternLeaving_home(
				this.items.id,
				this.items.state == 1 ? 2 : 1
			);
		},
		//
		onPromptConfirm2() {
			this.hintConfrimationShows = false;
			this.queryGroupingIndex();
		},
		//模态框取消事件
		onPromptCancels() {
			this.confrimationShows = false;
			this.isHome = !this.isHome;
			this.goHomeMode = this.goHomeMode - 1;
		},
		//检测修改状态
		async queryPatternTesting(id, state, fun) {
			let result = await getPatternTesting({
				id: id,
				state: state
			});
			fun(result);
		},
		//修改情景模式失败
		async submitPatternSend_error(id, name_of_device, state) {
			let result = await getPatternSend_error({
				id: id,
				name_of_device: name_of_device,
				state: state
			});
			console.log(result);
		},
		//修改情景模式
		async queryPatternLeaving_home(id, state) {
			this.$refs.loading.open();
			let resArrs = [];
			let result = await getPatternLeaving_home({
				id: id,
				state: state
			});
			console.log(result);

			let noAlterArr = [];
			if (result.code == 2010) {
				let clearIntervalbool = false;
				let setin = setInterval(() => {
					this.queryPatternTesting(id, state, res => {
						console.log(res);
						noAlterArr = res.data;
						if (res.data.length == 0) {
							clearInterval(setin);
							clearIntervalbool = true;
							this.queryGroupingIndex();
							this.$refs.loading.close();
						}
					});
				}, 3000);
				setTimeout(() => {
					if (!clearIntervalbool) {
						this.$refs.loading.close();
						let name_of_devices = [];
						let device_users = [];
						for (let i in noAlterArr) {
							name_of_devices.push(noAlterArr[i].name_of_device);
							device_users.push(noAlterArr[i].device_user);
						}
						this.hinContText = device_users.join('，');
						this.hintConfrimationShows = true;
						this.submitPatternSend_error(
							id,
							name_of_devices.join(','),
							state == 1 ? 2 : 1
						);
					}
					clearInterval(setin);
				}, 19000);

				// if (state == 1) {
				// 	uni.showToast({
				// 		icon: 'none',
				// 		title: '回家模式已开启' + this.items.title + '组设备已经可以控制'
				// 	})

				// } else {
				// 	uni.showToast({
				// 		icon: 'none',
				// 		title: '离家模式已开启' + this.items.title + '组设备已经锁定'
				// 	})
				// }
				// this.confrimationShows = false;
				// this.queryGroupingIndex()
			}
		}
	}
};
</script>

